description:
ホーンの代名詞！！フランス生まれのクラックスカー！！<br>
ヨーロピアンサウンド電子ホーンが訳ありの大特価！！！<br>
LOW側のみとなります！<br>
※外箱はございませんのでご了承ください。
<br>
<br>
■商品品番：H-510（赤）のLOW側のみ<br>
■電圧：12V<br>
■電流：10A以下（5A＋5A）<br>
■周波数：LOW:420Hz<br>
■寸法：φ100×D90<br>
■保証：6ヶ月<br>
■保安基準適合品<br>
■メーカー：HKT株式会社


